DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `select_menu`()
BEGIN
select menu.id_menu,menu.plato,menu.precio,menu.descripcion,categoria_menu.categoria,
	estado_menu.estado_menu,menu.stock,menu.url_img FROM categoria_menu INNER JOIN menu ON 
	menu.categoria=categoria_menu.id INNER JOIN estado_menu ON estado_menu.id_estado_menu=menu.estado ORDER BY categoria_menu.id asc;
END//
DELIMITER ;

